  queryUsers() {
    console.info('queryUsers');

    let result = this.apollo.query({
      query: gql`
        query {
          users {
            email
          }            
        }
      `,
    });
    result.subscribe((result) => {
      console.log(result);
    });
    return result;
  }
}

